import React from "react";
import {Route, Switch} from "react-router-dom";
import Header from "./Header";
import App from "./App";

const Main = () =>{
    return (
        <>
        <Header />
     

        <Switch>
            <Route exact path="/" component={Main} />
            <Route exact path="/App" component={App} />
        </Switch>

        </>
    );
};
export default Main;
